define({"topics" : [{"title":"Processors","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","href":"datacollector\/UserGuide\/Processors\/Processors_overview.html#concept_hpr_twm_jq","attributes": {"data-id":"concept_hpr_twm_jq",},"menu": {"hasChildren":false,},"tocID":"concept_hpr_twm_jq-d46e66880","topics":[]},{"title":"Aggregator","href":"datacollector\/UserGuide\/Processors\/Aggregator.html#concept_ofb_svm_5bb","attributes": {"data-id":"concept_ofb_svm_5bb",},"menu": {"hasChildren":true,},"tocID":"concept_ofb_svm_5bb-d46e66904","next":"concept_ofb_svm_5bb-d46e66904",},{"title":"Base64 Field Decoder","shortdesc":"\n            <p class=\"shortdesc\">The Base64 Field Decoder decodes Base64 encoded data to binary data. Use the processor         to decode Base64 encoded data\n               before evaluating data in the field.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/Base64Decoder.html#concept_ujj_spy_kv","attributes": {"data-id":"concept_ujj_spy_kv",},"menu": {"hasChildren":true,},"tocID":"concept_ujj_spy_kv-d46e67701","next":"concept_ujj_spy_kv-d46e67701",},{"title":"Base64 Field Encoder","shortdesc":"\n            <p class=\"shortdesc\">The Base64 Field Encoder encodes binary data using Base64. Use the processor to encode         binary data that must be sent\n               over channels that expect ASCII data.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/Base64Encoder.html#concept_wtr_mpy_kv","attributes": {"data-id":"concept_wtr_mpy_kv",},"menu": {"hasChildren":true,},"tocID":"concept_wtr_mpy_kv-d46e67758","next":"concept_wtr_mpy_kv-d46e67758",},{"title":"Data Generator","href":"datacollector\/UserGuide\/Processors\/DataGenerator.html#concept_hw1_gq4_3fb","attributes": {"data-id":"concept_hw1_gq4_3fb",},"menu": {"hasChildren":true,},"tocID":"concept_hw1_gq4_3fb-d46e67815","next":"concept_hw1_gq4_3fb-d46e67815",},{"title":"Data Parser","shortdesc":"\n            <p class=\"shortdesc\">The Data Parser processor allows you to parse supported data formats embedded in a         field. You can parse NetFlow embedded\n               in a byte array field or syslog messages embedded in a         string field. \n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/DataParser.html#concept_xw3_4xk_r1b","attributes": {"data-id":"concept_xw3_4xk_r1b",},"menu": {"hasChildren":true,},"tocID":"concept_xw3_4xk_r1b-d46e67966","next":"concept_xw3_4xk_r1b-d46e67966",},{"title":"Databricks ML Evaluator","shortdesc":"\n            <p class=\"shortdesc\">The Databricks ML Evaluator processor uses Spark-trained machine learning models to         generate evaluations, scoring,\n               or classifications of data. This processor <span class=\"ph\">is a <a class=\"xref\" href=\"datacollector\/UserGuide\/Pipeline_Design\/TechPreview.html#concept_prl_qfv_gfb\">Technology Preview</a> feature. It is not meant for use in                         production.</span>     \n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/DatabricksML.html#concept_nlz_k3v_gfb","attributes": {"data-id":"concept_nlz_k3v_gfb",},"menu": {"hasChildren":true,},"tocID":"concept_nlz_k3v_gfb-d46e68065","next":"concept_nlz_k3v_gfb-d46e68065",},{"title":"Delay","href":"datacollector\/UserGuide\/Processors\/Delay.html#concept_ez5_pvf_wbb","attributes": {"data-id":"concept_ez5_pvf_wbb",},"menu": {"hasChildren":true,},"tocID":"concept_ez5_pvf_wbb-d46e68131","next":"concept_ez5_pvf_wbb-d46e68131",},{"title":"Encrypt and Decrypt Fields","shortdesc":"\n            <p class=\"shortdesc\">The Encrypt and Decrypt Fields processor encrypts or decrypts field values. </p>\n         ","href":"datacollector\/UserGuide\/Processors\/EncryptDecrypt.html#concept_zs3_vfk_hfb","attributes": {"data-id":"concept_zs3_vfk_hfb",},"menu": {"hasChildren":true,},"tocID":"concept_zs3_vfk_hfb-d46e68185","next":"concept_zs3_vfk_hfb-d46e68185",},{"title":"Expression Evaluator","href":"datacollector\/UserGuide\/Processors\/Expression.html#concept_zm2_pp3_wq","attributes": {"data-id":"concept_zm2_pp3_wq",},"menu": {"hasChildren":true,},"tocID":"concept_zm2_pp3_wq-d46e68768","next":"concept_zm2_pp3_wq-d46e68768",},{"title":"Field Flattener","href":"datacollector\/UserGuide\/Processors\/FieldFlattener.html#concept_njn_3kk_fx","attributes": {"data-id":"concept_njn_3kk_fx",},"menu": {"hasChildren":true,},"tocID":"concept_njn_3kk_fx-d46e68979","next":"concept_njn_3kk_fx-d46e68979",},{"title":"Field Hasher","shortdesc":"\n            <p class=\"shortdesc\">The Field Hasher uses an algorithm to encode data. Use Field Hasher to encode         highly-sensitive data. For example,\n               you might use Field Hasher to encode social security or         credit card numbers.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/FieldHasher.html#concept_ivv_c3k_wq","attributes": {"data-id":"concept_ivv_c3k_wq",},"menu": {"hasChildren":true,},"tocID":"concept_ivv_c3k_wq-d46e69127","next":"concept_ivv_c3k_wq-d46e69127",},{"title":"Field Masker","shortdesc":"\n            <p class=\"shortdesc\">The Field Masker masks string values based on the selected mask type. You can use     variable-length, fixed-length, custom,\n               or regular expression masks. Custom masks can reveal part     of the string value.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/FieldMasker.html#concept_hjc_t4k_wq","attributes": {"data-id":"concept_hjc_t4k_wq",},"menu": {"hasChildren":true,},"tocID":"concept_hjc_t4k_wq-d46e69347","next":"concept_hjc_t4k_wq-d46e69347",},{"title":"Field Merger","shortdesc":"\n            <p class=\"shortdesc\">The Field Merger merges one or more fields in a record to a different location in the   record. Use only for records with\n               a list or map structure. \n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/FieldMerger.html#concept_pgm_tsl_gt","attributes": {"data-id":"concept_pgm_tsl_gt",},"menu": {"hasChildren":true,},"tocID":"concept_pgm_tsl_gt-d46e69449","next":"concept_pgm_tsl_gt-d46e69449",},{"title":"Field Order","shortdesc":"\n            <p class=\"shortdesc\">The Field Order processor orders fields in a map or list-map field and outputs the         fields into a list-map or list\n               root field. \n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/FieldOrder.html#concept_krp_5fv_vy","attributes": {"data-id":"concept_krp_5fv_vy",},"menu": {"hasChildren":true,},"tocID":"concept_krp_5fv_vy-d46e69506","next":"concept_krp_5fv_vy-d46e69506",},{"title":"Field Pivoter","href":"datacollector\/UserGuide\/Processors\/ListPivoter.html#concept_ekg_313_qw","attributes": {"data-id":"concept_ekg_313_qw",},"menu": {"hasChildren":true,},"tocID":"concept_ekg_313_qw-d46e69608","next":"concept_ekg_313_qw-d46e69608",},{"title":"Field Remover","href":"datacollector\/UserGuide\/Processors\/FieldRemover.html#concept_jdd_blr_wq","attributes": {"data-id":"concept_jdd_blr_wq",},"menu": {"hasChildren":true,},"tocID":"concept_jdd_blr_wq-d46e69707","next":"concept_jdd_blr_wq-d46e69707",},{"title":"Field Renamer","shortdesc":"\n            <p class=\"shortdesc\">Use the Field Renamer to rename fields in a record. You can specify individual fields to         rename or use regular expressions\n               to rename sets of fields. \n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/FieldRenamer.html#concept_vyv_zsg_ht","attributes": {"data-id":"concept_vyv_zsg_ht",},"menu": {"hasChildren":true,},"tocID":"concept_vyv_zsg_ht-d46e69761","next":"concept_vyv_zsg_ht-d46e69761",},{"title":"Field Replacer","shortdesc":"\n            <p class=\"shortdesc\">The Field Replacer replaces values in fields with nulls or with new values. Use the         Field Replacer to update values\n               or to replace invalid values.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/FieldReplacer.html#concept_rw4_2d3_4cb","attributes": {"data-id":"concept_rw4_2d3_4cb",},"menu": {"hasChildren":true,},"tocID":"concept_rw4_2d3_4cb-d46e69866","next":"concept_rw4_2d3_4cb-d46e69866",},{"title":"Field Splitter","shortdesc":"\n            <p class=\"shortdesc\">The Field Splitter splits string data based on a regular expression and passes the   separated data to new fields. Use the\n               Field Splitter to split complex string values into logical   components. \n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/FieldSplitter.html#concept_vlj_vph_yq","attributes": {"data-id":"concept_vlj_vph_yq",},"menu": {"hasChildren":true,},"tocID":"concept_vlj_vph_yq-d46e70086","next":"concept_vlj_vph_yq-d46e70086",},{"title":"Field Type Converter","shortdesc":"\n            <p class=\"shortdesc\">The Field Type Converter processor converts the data types of fields to compatible data     types. You might use the processor\n               to convert the data types of fields before performing     calculations. You can also use the processor to change the scale\n               of decimal data.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/FieldTypeConverter.html#concept_is3_zkp_wq","attributes": {"data-id":"concept_is3_zkp_wq",},"menu": {"hasChildren":true,},"tocID":"concept_is3_zkp_wq-d46e70300","next":"concept_is3_zkp_wq-d46e70300",},{"title":"Field Zip","href":"datacollector\/UserGuide\/Processors\/FieldZip.html#concept_o3b_t1k_yx","attributes": {"data-id":"concept_o3b_t1k_yx",},"menu": {"hasChildren":true,},"tocID":"concept_o3b_t1k_yx-d46e70458","next":"concept_o3b_t1k_yx-d46e70458",},{"title":"Geo IP","href":"datacollector\/UserGuide\/Processors\/GeoIP.html#concept_fch_fc3_ms","attributes": {"data-id":"concept_fch_fc3_ms",},"menu": {"hasChildren":true,},"tocID":"concept_fch_fc3_ms-d46e70668","next":"concept_fch_fc3_ms-d46e70668",},{"title":"Groovy Evaluator","href":"datacollector\/UserGuide\/Processors\/Groovy.html#concept_ldh_sct_gv","attributes": {"data-id":"concept_ldh_sct_gv",},"menu": {"hasChildren":true,},"tocID":"concept_ldh_sct_gv-d46e70950","next":"concept_ldh_sct_gv-d46e70950",},{"title":"HBase Lookup","shortdesc":"\n            <p class=\"shortdesc\">The HBase Lookup processor performs key-value lookups in HBase and passes the lookup         values to fields. Use the HBase\n               Lookup to enrich records with additional data.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/HBaseLookup.html#concept_mnj_zhq_bw","attributes": {"data-id":"concept_mnj_zhq_bw",},"menu": {"hasChildren":true,},"tocID":"concept_mnj_zhq_bw-d46e71889","next":"concept_mnj_zhq_bw-d46e71889",},{"title":"Hive Metadata","href":"datacollector\/UserGuide\/Processors\/HiveMetadata.html#concept_rz5_nft_zv","attributes": {"data-id":"concept_rz5_nft_zv",},"menu": {"hasChildren":true,},"tocID":"concept_rz5_nft_zv-d46e72273","next":"concept_rz5_nft_zv-d46e72273",},{"title":"HTTP Client","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_ghx_ypr_fw","attributes": {"data-id":"concept_ghx_ypr_fw",},"menu": {"hasChildren":true,},"tocID":"concept_ghx_ypr_fw-d46e73355","next":"concept_ghx_ypr_fw-d46e73355",},{"title":"JavaScript Evaluator","href":"datacollector\/UserGuide\/Processors\/JavaScript.html#concept_n2p_jgf_lr","attributes": {"data-id":"concept_n2p_jgf_lr",},"menu": {"hasChildren":true,},"tocID":"concept_n2p_jgf_lr-d46e74623","next":"concept_n2p_jgf_lr-d46e74623",},{"title":"JDBC Lookup","shortdesc":"\n            <p class=\"shortdesc\">The JDBC Lookup processor uses a JDBC connection to perform lookups in a database         table and pass the lookup values\n               to fields. Use the JDBC Lookup to enrich records with         additional data.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/JDBCLookup.html#concept_ysc_ccy_hw","attributes": {"data-id":"concept_ysc_ccy_hw",},"menu": {"hasChildren":true,},"tocID":"concept_ysc_ccy_hw-d46e75429","next":"concept_ysc_ccy_hw-d46e75429",},{"title":"JDBC Tee","href":"datacollector\/UserGuide\/Processors\/JDBCTee.html#concept_qbx_lcy_hw","attributes": {"data-id":"concept_qbx_lcy_hw",},"menu": {"hasChildren":true,},"tocID":"concept_qbx_lcy_hw-d46e75804","next":"concept_qbx_lcy_hw-d46e75804",},{"title":"JSON Generator","href":"datacollector\/UserGuide\/Processors\/JSONGenerator.html#concept_jmg_hw1_h1b","attributes": {"data-id":"concept_jmg_hw1_h1b",},"menu": {"hasChildren":true,},"tocID":"concept_jmg_hw1_h1b-d46e76014","next":"concept_jmg_hw1_h1b-d46e76014",},{"title":"JSON Parser","href":"datacollector\/UserGuide\/Processors\/JSONParser.html#concept_bs1_4t3_yq","attributes": {"data-id":"concept_bs1_4t3_yq",},"menu": {"hasChildren":true,},"tocID":"concept_bs1_4t3_yq-d46e76070","next":"concept_bs1_4t3_yq-d46e76070",},{"title":"Jython Evaluator","href":"datacollector\/UserGuide\/Processors\/Jython.html#concept_a1h_lkf_lr","attributes": {"data-id":"concept_a1h_lkf_lr",},"menu": {"hasChildren":true,},"tocID":"concept_a1h_lkf_lr-d46e76128","next":"concept_a1h_lkf_lr-d46e76128",},{"title":"Kudu Lookup","shortdesc":"\n            <p class=\"shortdesc\">The Kudu Lookup processor performs lookups in a Kudu table and passes the lookup         values to fields. Use the Kudu Lookup\n               to enrich records with additional data.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/KuduLookup.html#concept_a1x_3wl_p1b","attributes": {"data-id":"concept_a1x_3wl_p1b",},"menu": {"hasChildren":true,},"tocID":"concept_a1x_3wl_p1b-d46e76934","next":"concept_a1x_3wl_p1b-d46e76934",},{"title":"Log Parser","href":"datacollector\/UserGuide\/Processors\/LogParser.html#concept_ulm_qdq_fs","attributes": {"data-id":"concept_ulm_qdq_fs",},"menu": {"hasChildren":true,},"tocID":"concept_ulm_qdq_fs-d46e77302","next":"concept_ulm_qdq_fs-d46e77302",},{"title":"MLeap Evaluator","shortdesc":"\n            <p class=\"shortdesc\">The MLeap Evaluator processor uses machine learning models stored in MLeap format to         generate evaluations, scoring,\n               or classifications of data. This processor <span class=\"ph\">is a <a class=\"xref\" href=\"datacollector\/UserGuide\/Pipeline_Design\/TechPreview.html#concept_prl_qfv_gfb\">Technology Preview</a> feature. It is not meant for use in                         production.</span>     \n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/MLeap.html#concept_wnr_wlv_gfb","attributes": {"data-id":"concept_wnr_wlv_gfb",},"menu": {"hasChildren":true,},"tocID":"concept_wnr_wlv_gfb-d46e77401","next":"concept_wnr_wlv_gfb-d46e77401",},{"title":"MongoDB Lookup","shortdesc":"\n            <p class=\"shortdesc\">The MongoDB Lookup processor performs lookups in MongoDB and passes all values from         the returned document to a new\n               list-map field in the record. Use the MongoDB Lookup         processor to enrich records with additional data.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/MongoDBLookup.html#concept_rrp_t4w_2fb","attributes": {"data-id":"concept_rrp_t4w_2fb",},"menu": {"hasChildren":true,},"tocID":"concept_rrp_t4w_2fb-d46e77464","next":"concept_rrp_t4w_2fb-d46e77464",},{"title":"PMML Evaluator","shortdesc":"\n            <p class=\"shortdesc\">The PMML Evaluator processor uses a machine learning model stored in the Predictive         Model Markup Language (PMML) format\n               to generate evaluations, scoring, or classifications of         data. This processor <span class=\"ph\">is a <a class=\"xref\" href=\"datacollector\/UserGuide\/Pipeline_Design\/TechPreview.html#concept_prl_qfv_gfb\">Technology Preview</a> feature. It is not meant for use in                         production.</span></p>\n         ","href":"datacollector\/UserGuide\/Processors\/PMML.html#concept_r3s_3fv_gfb","attributes": {"data-id":"concept_r3s_3fv_gfb",},"menu": {"hasChildren":true,},"tocID":"concept_r3s_3fv_gfb-d46e77934","next":"concept_r3s_3fv_gfb-d46e77934",},{"title":"PostgreSQL Metadata","href":"datacollector\/UserGuide\/Processors\/JDBCMetadata.html#concept_lcp_ssh_qcb","attributes": {"data-id":"concept_lcp_ssh_qcb",},"menu": {"hasChildren":true,},"tocID":"concept_lcp_ssh_qcb-d46e77996","next":"concept_lcp_ssh_qcb-d46e77996",},{"title":"Record Deduplicator","shortdesc":"\n            <p class=\"shortdesc\">The Record Deduplicator evaluates records for duplicate data and routes data to two         streams -  one for unique records\n               and one for duplicate records. Use the Record Deduplicator         to discard duplicate data or route duplicate data through\n               different processing logic. \n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/RDeduplicator.html#concept_z3m_v52_zq","attributes": {"data-id":"concept_z3m_v52_zq",},"menu": {"hasChildren":true,},"tocID":"concept_z3m_v52_zq-d46e78281","next":"concept_z3m_v52_zq-d46e78281",},{"title":"Redis Lookup","shortdesc":"\n            <p class=\"shortdesc\">The Redis Lookup processor performs key-value lookups in Redis and passes the lookup         values to fields. Use the Redis\n               Lookup to enrich records with additional data.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/RedisLookup.html#concept_ng3_lpr_pv","attributes": {"data-id":"concept_ng3_lpr_pv",},"menu": {"hasChildren":true,},"tocID":"concept_ng3_lpr_pv-d46e78383","next":"concept_ng3_lpr_pv-d46e78383",},{"title":"Salesforce Lookup","shortdesc":"\n            <p class=\"shortdesc\">The Salesforce Lookup processor performs lookups in a Salesforce object and passes         the lookup values to fields. Use\n               the Salesforce Lookup to enrich records with additional         data.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/SalesforceLookup.html#concept_k23_3rk_yx","attributes": {"data-id":"concept_k23_3rk_yx",},"menu": {"hasChildren":true,},"tocID":"concept_k23_3rk_yx-d46e78543","next":"concept_k23_3rk_yx-d46e78543",},{"title":"Schema Generator","href":"datacollector\/UserGuide\/Processors\/SchemaGenerator.html#concept_rfz_ks3_x1b","attributes": {"data-id":"concept_rfz_ks3_x1b",},"menu": {"hasChildren":true,},"tocID":"concept_rfz_ks3_x1b-d46e78832","next":"concept_rfz_ks3_x1b-d46e78832",},{"title":"Spark Evaluator","shortdesc":"\n            <p class=\"shortdesc\">The Spark Evaluator performs custom processing within a pipeline based on a Spark         application that you develop.</p>\n         ","href":"datacollector\/UserGuide\/Processors\/Spark.html#concept_cpx_1lm_zx","attributes": {"data-id":"concept_cpx_1lm_zx",},"menu": {"hasChildren":true,},"tocID":"concept_cpx_1lm_zx-d46e79043","next":"concept_cpx_1lm_zx-d46e79043",},{"title":"SQL Parser","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","href":"datacollector\/UserGuide\/Processors\/SQLParser.html#concept_zh2_kfj_tdb","attributes": {"data-id":"concept_zh2_kfj_tdb",},"menu": {"hasChildren":true,},"tocID":"concept_zh2_kfj_tdb-d46e79424","next":"concept_zh2_kfj_tdb-d46e79424",},{"title":"Static Lookup","shortdesc":"\n            <p class=\"shortdesc\">The Static Lookup processor performs lookups of key-value pairs that are stored in local         memory and passes the lookup\n               values to fields. Use the Static Lookup to store String values         in memory that the pipeline can look up at runtime\n               to enrich records with additional         data.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/StaticLookup.html#concept_aqz_t4r_pv","attributes": {"data-id":"concept_aqz_t4r_pv",},"menu": {"hasChildren":true,},"tocID":"concept_aqz_t4r_pv-d46e79987","next":"concept_aqz_t4r_pv-d46e79987",},{"title":"Stream Selector","shortdesc":"\n            <p class=\"shortdesc\">The Stream Selector passes data to streams based on conditions. Define a condition for     each stream of data that you want\n               to create. The Stream Selector uses a default stream to pass     records that do not match user-defined conditions. \n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/StreamSelector.html#concept_tqv_t5r_wq","attributes": {"data-id":"concept_tqv_t5r_wq",},"menu": {"hasChildren":true,},"tocID":"concept_tqv_t5r_wq-d46e80047","next":"concept_tqv_t5r_wq-d46e80047",},{"title":"TensorFlow Evaluator","shortdesc":"\n            <p class=\"shortdesc\">The TensorFlow Evaluator processor uses a TensorFlow machine learning model to         generate predictions or classifications\n               of data. The TensorFlow Evaluator processor <span class=\"ph\">is a <a class=\"xref\" href=\"datacollector\/UserGuide\/Pipeline_Design\/TechPreview.html#concept_prl_qfv_gfb\">Technology Preview</a> feature. It is not meant for use in                         production.</span></p>\n         ","href":"datacollector\/UserGuide\/Processors\/TensorFlow.html#concept_otg_csh_z2b","attributes": {"data-id":"concept_otg_csh_z2b",},"menu": {"hasChildren":true,},"tocID":"concept_otg_csh_z2b-d46e80204","next":"concept_otg_csh_z2b-d46e80204",},{"title":"Value Replacer (Deprecated)","href":"datacollector\/UserGuide\/Processors\/ValueReplacer.html#concept_o5k_dmf_zq","attributes": {"data-id":"concept_o5k_dmf_zq",},"menu": {"hasChildren":true,},"tocID":"concept_o5k_dmf_zq-d46e80684","next":"concept_o5k_dmf_zq-d46e80684",},{"title":"Whole File Transformer","shortdesc":"\n            <p class=\"shortdesc\">The Whole File Transformer processor transforms fully written Avro files to highly         efficient, columnar Parquet files.\n               Use the Whole File Transformer in a pipeline that reads         Avro files as whole files and writes the transformed Parquet\n               files as whole         files.\n            </p>\n         ","href":"datacollector\/UserGuide\/Processors\/WholeFileTransformer.html#concept_nwg_rx4_l2b","attributes": {"data-id":"concept_nwg_rx4_l2b",},"menu": {"hasChildren":true,},"tocID":"concept_nwg_rx4_l2b-d46e80966","next":"concept_nwg_rx4_l2b-d46e80966",},{"title":"XML Flattener","href":"datacollector\/UserGuide\/Processors\/XMLFlattener.html#concept_ck4_255_sv","attributes": {"data-id":"concept_ck4_255_sv",},"menu": {"hasChildren":true,},"tocID":"concept_ck4_255_sv-d46e81798","next":"concept_ck4_255_sv-d46e81798",},{"title":"XML Parser","href":"datacollector\/UserGuide\/Processors\/XMLParser.html#concept_dtt_q5q_k5","attributes": {"data-id":"concept_dtt_q5q_k5",},"menu": {"hasChildren":true,},"tocID":"concept_dtt_q5q_k5-d46e81897","next":"concept_dtt_q5q_k5-d46e81897",}]});